import Icon_windowsXp from "../assets/images/icon_windowsXp.png";

export default function FooterHome() {
	return (
		<div className="footerHome">
            <div className="iconWindows">
                <img src={Icon_windowsXp} alt="icon_windowsXp" />

			</div>
		</div>
	);
}
